import React, { useEffect, useState } from "react";

const OptimizeTest1 = () => {
  const [count, setCount] = useState(1);
  const [obj, setObj] = useState({
    count: 1,
  });
  return (
    <div style={{ padding: 50 }}>
      <div>
        <h2>Counter A</h2>
        <button onClick={() => setCount(count)}>A button</button>
      </div>
    </div>
  );
};

export default OptimizeTest2;
